import React from "react";
import "./productlist.css";

const ProductList = () => {
  return (
    <div className="pl">
      <div className="pl-texts">
        <h1 className="pl-title"></h1>
        <p className="pl-desc"></p>
      </div>
    </div>
  );
};

export default ProductList;
